informacaoComplementar:
4.1 A Comunicação Não-Violenta (CNV) é uma abordagem reconhecida por promover e facilitar diálogos e melhorar as relações interpessoais, com foco na busca pela mediação de conflitos e respeito mútuo. A necessidade dessa temática no contexto do Conselho Regional de Psicologia de São Paulo CRP-SP tornou-se evidente a partir do diagnóstico institucional realizado, que revelou dificuldades recorrentes nas interações entre trabalhadoras/es e trabalhadoras/es e conselheiras/os. Essas dificuldades impactam tanto o ambiente organizacional quanto a eficiência das atividades desenvolvidas pela autarquia;

4.2 Ao compartilhar os resultados da análise com todas as partes envolvidas, emergiu um consenso sobre a importância de tratar essa questão em uma palestra programada como parte das atividades de encerramento do ano de 2024. Esta decisão reflete o compromisso da organização em promover um ambiente mais colaborativo e saudável a todas as/os trabalhadoras/es e faz parte das ações preparatórias à implementação do programa e política de qualidade de vida;

4.3 Dessa forma, a palestra sobre CNV não é apenas um evento pontual, mas uma ação estratégica para fortalecer competências interpessoais, reduzir conflitos e alinhar práticas comunicativas aos valores institucionais do CRP-SP. A expectativa é que essa atividade sirva como um ponto de partida para a construção de relações mais harmônicas e produtivas no cotidiano da autarquia, beneficiando diretamente o desempenho coletivo e individual;

4.4 A contratação de um/a especialista para ministrar essa palestra é fundamental para garantir que o tema seja abordado de forma prática, acessível e com a profundidade necessária, fornecendo ferramentas aplicáveis que possam ser incorporadas ao cotidiano de trabalho das/os participantes;

4.5 A não contratação de profissional para realizar a palestra inviabilizará o objetivo da instituição de capacitar os servidores a lidarem com conflitos de maneira construtiva.

